        <div style={{ position: 'absolute', top: '100%', left: '50%', transform: 'translateX(-50%)', background: 'black', color: 'white', padding: '5px', borderRadius: '3px' }}>
          {content}
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```

