```

2. **JavaScript for Sorting**: Create a JavaScript file (`sortableTable.js`) to handle the sorting logic.

```javascript
let sortDirection = true; // true for ascending, false for descending

function sortTable(columnIndex) {
    const table = document.getElementById('sortableTable');
    const tbody = table.getElementsByTagName('tbody')[0];
    const rows = Array.from(tbody.getElementsByTagName('tr'));

    // Determine the type of data in the column for sorting
    const isNumeric = rows.every(row => !isNaN(row.cells[columnIndex].innerText));

    // Sort the rows based on the column index
    rows.sort((a, b) => {
        const aValue = a.cells[columnIndex].innerText;
        const bValue = b.cells[columnIndex].innerText;

        if (isNumeric) {
            return sortDirection ? aValue - bValue : bValue - aValue;
        } else {
            return sortDirection ? aValue.localeCompare(bValue) : bValue.localeCompare(aValue);
        }
    });

    // Reverse the sort direction for the next click
    sortDirection = !sortDirection;

    // Reattach the sorted rows to the tbody
    rows.forEach(row => tbody.appendChild(row));
}
```

3. **Explanation**:
   - The `sortTable` function takes a `columnIndex` parameter, which indicates the column to sort by.
   - The `sortDirection` variable toggles between ascending and descending order.
   - The function retrieves the table and its rows, then sorts the rows based on the content of the specified column.
   - The `isNumeric` variable checks if the column contains numeric data to apply the appropriate sorting method.
   - The sorted rows are reattached to the table body in the new order.

With this setup, clicking on the table headers will sort the table alphanumerically without the need for jQuery or other plugins.

